import React, { Component } from 'react';

import '../css/styles.css'




    const Header = () =>{
    return (
            <header>
                <div
                    className="logo"
                    onClick={ this.inputChange }
                >Logo
                </div>
                <input
                    type='text'
                    onChange={this.props.keywords}

                />


            </header>
        )
    }


export default Header;
